// ============================= Google Maps TEST =============================
// AIzaSyCoOZKGkK9Ili7RHCrB0dVNqhy6_e1yKyM

import React, { Component } from 'react';
import {Map, InfoWindow, Marker, GoogleApiWrapper} from 'google-maps-react';
import NavbarMaps from '../../components/common/navbarMaps';
import './maps.css'

const mapStyles = {
    top: '0',
    buttom: '0',
    width: '1140px',
    height: '725px',
    left: '300px',
};

export class MapContainer extends Component {
    state = {
        showingInfoWindow: false,
        activeMarker: {},
        selectedPlace: {},
        placename:'',
    };

    onMarkerClick = (props, marker, e) =>
        this.setState({
            selectedPlace: props,
            activeMarker: marker,
            showingInfoWindow: true,
            placename: props.name,
        });

    onMapClicked = (props) => {
        if (this.state.showingInfoWindow) {
            this.setState({
                showingInfoWindow: false,
                activeMarker: null
            })
        }
    };
render() {
    // let placename;
    return (  
        <>
            <NavbarMaps />
            <div class="sidenav">
                <div class="sidePlaceName">Phuket</div>
                {this.state.placename === "หาดสุรินทร์"? 
                    <>
                        <div class="sideLinkBox" to="https://pantip.com/topic/39530285">
                            <div class="sideLinkTitle">[CR] เที่ยวไปกินไป by laser @ ภูเก็ต 2</div>
                            <div class="sideLinkDesc">Read : 256</div>
                        </div>  
                        <div class="sideLinkBox" to="https://pantip.com/topic/40091067">
                            <div class="sideLinkTitle">[CR] ภูเก็ตฟีลนี้ คือโคตรดี!!</div>
                            <div class="sideLinkDesc">Read : 213</div>
                        </div>  
                        <div class="sideLinkBox" to="https://pantip.com/topic/39530285">
                            <div class="sideLinkTitle">[CR] เที่ยวไปกินไป by laser @ ภูเก็ต 2</div>
                            <div class="sideLinkDesc">Read : 185</div>
                        </div>  
                        <div class="sideLinkBox" to="https://pantip.com/topic/40091067">
                            <div class="sideLinkTitle">[CR] ภูเก็ตฟีลนี้ คือโคตรดี!!</div>
                            <div class="sideLinkDesc">Read : 213</div>
                        </div>  

                    </>
                :   (this.state.placename === "หาดกะรน"? 
                        <>
                            <div class="sideLinkBox">
                                <div class="sideLinkTitle"></div>
                                <div class="sideLinkDesc">Read : 256</div>
                            </div>  
                        </>
                :  (this.state.placename === "วัดฉลอง"? 
                        <>
                            <div class="sideLinkBox">
                                <div class="sideLinkTitle"></div>
                                <div class="sideLinkDesc">Read : 256</div>
                            </div>  
                        </>
                :  (this.state.placename === "แหลมพรหมเทพ"? 
                        <>
                            <div class="sideLinkBox">
                                <div class="sideLinkTitle"></div>
                                <div class="sideLinkDesc">Read : 256</div>
                            </div>  
                        </>
                :  <></>
                )))}
            </div>

            <Map google={this.props.google}
                style={mapStyles}
                zoom={11}
                initialCenter={{lat: 7.95193, lng: 98.3381}}>
                <Marker
                    onClick={this.onMarkerClick}
                    name={'หาดสุรินทร์'}
                    url={'https://pantip.com/topic/40091067'}
                    position={{lat: 7.97547, lng: 98.2785}} />
                <Marker
                    onClick={this.onMarkerClick}
                    name={'หาดกะรน'}
                    url={'https://pantip.com/topic/39936903'}
                    position={{lat: 7.8439, lng: 98.2936}} />
                <Marker
                    onClick={this.onMarkerClick}
                    name={'วัดฉลอง'}
                    url={'https://pantip.com/topic/40207039'}
                    position={{lat: 7.84707, lng: 98.3363}} />
                <Marker
                    onClick={this.onMarkerClick}
                    name={'แหลมพรหมเทพ'}
                    url={'https://pantip.com/topic/40155571'}
                    position={{lat: 7.75886, lng: 98.3035}} />

                <InfoWindow
                    marker={this.state.activeMarker}
                    visible={this.state.showingInfoWindow}>
                    <div>
                        <p>{this.state.selectedPlace.name}</p>
                    </div>
                </InfoWindow>
            </Map>
        </>
    );
}
}

export default GoogleApiWrapper({
    apiKey: ('AIzaSyCoOZKGkK9Ili7RHCrB0dVNqhy6_e1yKyM')
})(MapContainer)
